-- Structure for table `system_logs`
DROP TABLE IF EXISTS `system_logs`;
CREATE TABLE `system_logs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `level` enum('debug','info','warning','error','critical') COLLATE utf8mb4_unicode_ci DEFAULT 'info',
  `message` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `context` json DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `ip_address` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `user_agent` text COLLATE utf8mb4_unicode_ci,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `idx_level_date` (`level`,`created_at`),
  KEY `idx_user_date` (`user_id`,`created_at`),
  CONSTRAINT `system_logs_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- Structure for table `transactions_wave`
DROP TABLE IF EXISTS `transactions_wave`;
CREATE TABLE `transactions_wave` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `prestataire_id` int(11) NOT NULL,
  `plan_id` int(11) NOT NULL,
  `transaction_id_wave` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `montant` decimal(10,2) NOT NULL,
  `devise` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT 'FCFA',
  `statut` enum('en_attente','valide','rejete','rembourse') COLLATE utf8mb4_unicode_ci DEFAULT 'en_attente',
  `validee_par_admin_id` int(11) DEFAULT NULL,
  `motif_rejet` text COLLATE utf8mb4_unicode_ci,
  `date_paiement` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `date_validation` timestamp NULL DEFAULT NULL,
  `duree_abonnement_jours` int(11) DEFAULT '30',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `plan_id` (`plan_id`),
  KEY `validee_par_admin_id` (`validee_par_admin_id`),
  KEY `idx_prestataire_statut` (`prestataire_id`,`statut`),
  KEY `idx_transaction_wave` (`transaction_id_wave`),
  CONSTRAINT `transactions_wave_ibfk_1` FOREIGN KEY (`prestataire_id`) REFERENCES `prestataires` (`id`) ON DELETE CASCADE,
  CONSTRAINT `transactions_wave_ibfk_2` FOREIGN KEY (`plan_id`) REFERENCES `plans_abonnement` (`id`),
  CONSTRAINT `transactions_wave_ibfk_3` FOREIGN KEY (`validee_par_admin_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

