-- Structure for table `user_notification_preferences`
DROP TABLE IF EXISTS `user_notification_preferences`;
CREATE TABLE `user_notification_preferences` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `push_enabled` tinyint(4) DEFAULT '1',
  `email_enabled` tinyint(4) DEFAULT '1',
  `sms_enabled` tinyint(4) DEFAULT '0',
  `new_reservation` tinyint(4) DEFAULT '1',
  `reservation_confirmed` tinyint(4) DEFAULT '1',
  `reservation_cancelled` tinyint(4) DEFAULT '1',
  `new_publication` tinyint(4) DEFAULT '0',
  `new_like` tinyint(4) DEFAULT '0',
  `new_comment` tinyint(4) DEFAULT '0',
  `new_follower` tinyint(4) DEFAULT '0',
  `promotions` tinyint(4) DEFAULT '1',
  `tips` tinyint(4) DEFAULT '1',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_user_preferences` (`user_id`),
  KEY `idx_notification_prefs_user` (`user_id`),
  CONSTRAINT `user_notification_preferences_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

